/* Styles */
import './opinionCard.scss';

/* Images */
import almOpImg from '../../../../imgs/home/opinion-sect01.png';

export function OpinionCard(opinion, personLvl, title, description, key) {
    return (
        <div className="cards">
            <div className="card">
                <img src={almOpImg} alt=""/>
                <div className="card-content">
                    <h3>ALUMNA</h3>
                    <h1>La institucion es muy divertida</h1>
                    <p>Aenean nec neque sem. Nam molestie nunc nec lectus feugiat, id pretium nisl sollicitudin. Donec ut pharetra lectus. Aliquam massa odio, viverra in dictum et, aliquam et eros. Mauris at augue dapibus, viverra leo nec, aliquet ligula. Mauris quis vestibulum nibh. Curabitur eu augue volutpat tellus pretium suscipit.</p>
                </div>
            </div>
        </div>
    );
}
